%% Parameters for the wind turbine

% Toolbox release
TBXR = 2.0;

%% Blade & Rotor parameters

% Rotor radius [m]
R = 50.3;

% Effective blade length (for wind speed correction) [m]
L = 40.3;

% Distance of the centre of mass from the hub axis [m]
Rc = 1.5;

% One blade mass [Kg]
Mblade = 11597;

% One blade mass*3 [Kg]
Mbl = Mblade*3;

% Hub height [m]
h = 100.6;

% Tower/Rotor cross-coupling inertia [Kg*m^2]
Jc = Rc*h*Mbl;

% Flap natural frequency [rad/s]
w_f = 5.3784;

% Rotor inertia [Kg*m^2]
J = 1.1366e+007;

% Blade flapwise stiffness [Nm/rad]
Kf = w_f^2*J;

% Edge natural frequency [rad/s]
w_e = 7.49584;

% Blade edgewise stiffness [Nm/rad]
Ke = w_e^2*J;

% Rotor and nacelle mass [Kg]
Mr_n = 151490;

%% Tower parameters

% Tower fore-aft inertia [Kg*m^2]
Jt = h^2*(Mr_n-Mbl);

% Tower fore-aft frequency [rad/s]
w_t = 2.55;

% Tower fore-aft damping
Bt_param = 0.008;
% Tower fore-aft damping moment [Nm]
Bt = 2*Bt_param*w_t*Jt;

% Tower fore-aft stiffness [Nm/rad]
Kt = w_t^2*Jt;

% Tower side-side natural frequency [rad/s]
w_ts = 2.60752;

% Tower side-side inertia [Kg*m^2]
Jts = h^2*Mr_n;

% Tower side-side stiffness [Nm/rad]
Kts = w_ts^2*Jts;

% Tower side-side damping
Bts_param = 0.008;
% Tower side-side damping moment [Nm]
Bts = 2*Bts_param*w_ts*Jts;

% Coefficient to adjust tower/nacelle displacement
Ka = 1;

%% Pitch Actuator parameters

% Pitch actuator transfer function
Gpac_num = '[1]';
GpacNum = [1];

Gpac_den = '[0.01 0.2 1]';
GpacDen = [0.01 0.2 1];

td = 0;

s = tf('s');
Gpac = tf( [1], [0.01 0.2 1] )*(2 - td*s)/(2 + td*s);

%% Generator Actuator parameters

% Generator actuator transfer function
Gqac_num = '[1]';

Gqac_den = '[1]';

Gqac = tf( [1], [1] );

%% Operational parameters

% Minimum generator speed in generation mode [rad/s]
WMIN = 0.9425;

% Maximum generator speed in generation mode [rad/s]
WMAX = 1.5708;

% Cut in wind speed [m/s]
WCUTIN = 4;

% Cut out wind speed [m/s]
WCUTOUT = 25;

% Nominal generator torque [Nm]
TQSET = 2.15e+006;

% Minimum pitch angle [deg]
PITMIN = -2;

% Maximum pitch angle [deg]
PITMAX = 90;

% sampling time [s]
sample_time = 0.01;

